import styled from "styled-components";

export default function FlexColumn({
    children,
    minWidth = '70%',
    customStyle = '',
}) {
    const Column = styled.div`
        display: flex;
        flex-direction: column;
        flex-wrap: nowrap;
        height: calc(100vh - 50px);
        ${customStyle};
    `;

    return(
        <Column>
            {children}
        </Column>
    );
}
